import React from 'react';
import Menu from '../../../general/menu_top/menu';
import Navbar from '../../../general/navbar/navbar';
import './header_signin.css';
import FormSignIn from '../form_signin/form_signin';



class HeaderSignIn extends React.Component{
  render(){

    $(document).ready(function(){
      $(window).scroll(function(){
        var element = document.getElementById("mobile");
        var scroll = $(window).scrollTop();
        if (scroll > 120) {
          element.classList.add("fixed-top");
          $("#mobile").css("background" , "rgba(26,26,26,0.9)");
        }
        else{
          $("#mobile").css("background" , "none");
          element.classList.remove("fixed-top");
        }
      })
    })

    return(
      <div className="bgs-img">
        <div id="header" className="container">
          <Menu/>
          <Navbar/>
          <FormSignIn/>
        </div>
      </div>
    )
  }
}
export default HeaderSignIn
